import {useState, useEffect} from 'react';

import classes from './OneDetailResponse.module.css';

import {getoneexamdetailresponse} from '../../../../../../CommonApps/AllAPICalls';

const OneDetailResponse=(props)=>{


    const [oneExamResponseData, getOneExamResponseData]	= useState(null);



    useEffect(()=>{

    let responseId = props.responseId;
     getoneexamdetailresponse({responseId, getOneExamResponseData}); 


    },[]);


   console.log("oneExamResponseData: ", oneExamResponseData);

   const goBackHandler=()=>{


   }



return <div className={classes.oneDetailResponse}>

    <div className={classes.topResponsebar}>
	<button type="button" style={{width:"100px", borderColor:"lightgrey", borderWidth:'1px',borderRadius:"5px"}}
		onClick={goBackHandler}> Back </button>	
    </div>

    <div className={classes.responseContentDiv}> 

      { oneExamResponseData !==null && oneExamResponseData.map((oneRes, index)=>{


	     return <div key={index} className={classes.oneTaskResponseDiv}> 

		      {

			  Object.keys(oneRes).indexOf("taskId") >=0 && <div className={classes.oneTaskResDetail}>  
			                                               <div> {oneRes.taskTitle}  </div>
                                                                          { oneRes.questionResponses.map((question, index)=>{

								 return <div key={index}> {"Qn No. "}{question.questionNum}
										         <span style={{color:"blue"}}> {"---"}{question.answerText}</span>
										          {"---"} {question.correct}  
										 </div>

									        }
									     )

									  }

			                                               </div>






		      }


                      {

                        Object.keys(oneRes).indexOf("writingTaskId") >=0 && <div className={classes.oneTaskResDetail}>

                              <div> {oneRes.writingTaskTitle} </div>

                              <div>  {oneRes.paragraphText} </div>

                              </div>


		      }




		    </div> 


          })

      }		



    </div>




</div>


}

export default OneDetailResponse;
